func TestSimpleDAO_ExecuteProposal(t *testing.T) {
	t.Parallel()

	t.Run("caller cannot cover fee", func(t *testing.T) {
		t.Parallel()

		var (
			sentCoins = std.NewCoins(
				std.NewCoin(
					"ugnot",
					minExecuteFeeValue-1,
