package simpledao

import (
	"errors"

	"gno.land/p/demo/avl"
	"gno.land/p/demo/dao"
	"gno.land/p/demo/membstore"
)

var ErrAlreadyVoted = errors.New("vote already cast")

// tally is a simple vote tally system
type tally struct {
	// tally cache to keep track of active
	// yes / no / abstain votes
	yays     uint64
	nays     uint64
	abstains uint64

	voters *avl.Tree // std.Address -> dao.VoteOption
}

// newTally creates a new tally system instance
func newTally() *tally {
	return &tally{
		voters: avl.NewTree(),
	}
}

// castVote casts a single vote in the name of the given member
func (t *tally) castVote(member membstore.Member, option dao.VoteOption) error {
	// Check if the member voted already
	address := member.Address.String()

	_, voted := t.voters.Get(address)
	if voted {
		return ErrAlreadyVoted
	}

	// Update the tally
	switch option {
	case dao.YesVote:
		t.yays += member.VotingPower
	case dao.AbstainVote:
		t.abstains += member.VotingPower
	default:
		t.nays += member.VotingPower
	}

	// Save the voting status
	t.voters.Set(address, option)

	return nil
}

package executor

import (
	"errors"
	"std"
)

var errInvalidCaller = errors.New("invalid executor caller")

// NewCallbackExecutor creates a new callback executor with the provided callback function
func NewCallbackExecutor(callback func() error, path string) *CallbackExecutor {
	return &CallbackExecutor{
		callback:   callback,
		daoPkgPath: path,
	}
}

// CallbackExecutor is an implementation of the dao.Executor interface,
// based on a specific callback.
// The given callback should verify the validity of the govdao call
type CallbackExecutor struct {
	callback   func() error // the callback to be executed
	daoPkgPath string       // the active pkg path of the govdao
}

// Execute runs the executor's callback function.
func (exec *CallbackExecutor) Execute() error {
	// Verify the caller is an adequate Realm
	caller := std.CurrentRealm().PkgPath()
	if caller != exec.daoPkgPath {
		return errInvalidCaller
	}

	if exec.callback != nil {
		return exec.callback()
	}

	return nil
}

package executor

import (
	"errors"
	"std"

	"gno.land/p/demo/context"
)

type propContextKey string

func (k propContextKey) String() string { return string(k) }

const (
	statusContextKey = propContextKey("govdao-prop-status")
	approvedStatus   = "approved"
)

var errNotApproved = errors.New("not approved by govdao")

// CtxExecutor is an implementation of the dao.Executor interface,
// based on the given context.
// It utilizes the given context to assert the validity of the govdao call
type CtxExecutor struct {
	callbackCtx func(ctx context.Context) error // the callback ctx fn, if any
	daoPkgPath  string                          // the active pkg path of the govdao
}

// NewCtxExecutor creates a new executor with the provided callback function.
func NewCtxExecutor(callback func(ctx context.Context) error, path string) *CtxExecutor {
	return &CtxExecutor{
		callbackCtx: callback,
		daoPkgPath:  path,
	}
}

// Execute runs the executor's callback function
func (exec *CtxExecutor) Execute() error {
	// Verify the caller is an adequate Realm
	caller := std.CurrentRealm().PkgPath()
	if caller != exec.daoPkgPath {
		return errInvalidCaller
	}

	// Create the context
	ctx := context.WithValue(
		context.Empty(),
		statusContextKey,
		approvedStatus,
	)

	return exec.callbackCtx(ctx)
}

// IsApprovedByGovdaoContext asserts that the govdao approved the context
func IsApprovedByGovdaoContext(ctx context.Context) bool {
	v := ctx.Value(statusContextKey)
	if v == nil {
		return false
	}

	vs, ok := v.(string)

	return ok && vs == approvedStatus
}

// AssertContextApprovedByGovDAO asserts the given context
// was approved by GOVDAO
func AssertContextApprovedByGovDAO(ctx context.Context) {
	if IsApprovedByGovdaoContext(ctx) {
		return
	}

	panic(errNotApproved)
}

